import React from "react";
import "../src/css/help.css";
function Help() {
  return (
    <div className="helmain">
      <div className="helbody">
        <div>
        <textarea id="hta" cols="60" rows="20"></textarea>
        </div>
        <div className="helb">
          <button>SUBMIT</button>
        </div>
      </div>
    </div>
  );
}
export default Help;
